import React from 'react';

function PortfolioBox(props) {
  return (
    <div>
      {/* <img src={props.item.img}></img> */}
      <h3>{props.item.title}</h3>
      <h3>{props.item.description}</h3>
    </div>
  );
}

export default PortfolioBox;
